import React from 'react';
import {MdAdd}from 'react-icons/md'
import './TodoInsert.scss';

const TodoInsert = ({children}) =>{
  return (
    <div className="TodoInsert">
      <input placeholder="할 일을 입력하세요"/>
      <button type="submit">
        <MdAdd/>
      </button>
    </div>
  )
}
export default TodoInsert;
